import {useState} from 'react';


const SearchBar = () => {

    const [searchItem, updateSearchItem] = useState("");

    return (
        <div className="search-bar">
            <form >
                <input type="text" onChange = { e => updateSearchItem(e.target.value)}/>
                <button onClick={() => console.log(searchItem)}>Search</button>
            </form>
        </div>
    )
}

export default SearchBar
